;; **
;;; # Gamma Correction
;; **

;; @@
(ns squealing-valley
  (:require
    [opencv4.utils :as u]
    [opencv4.gorilla :as g]
    [opencv4.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Create a lookup LUT table from a 1 channel mat
;; **

;; @@
(defn lookup-mat [_gamma] 
  (let[lut-mat (new-mat 1 256 CV_8UC1) ]
    (doseq [i (range 1 256)]  
      (.put lut-mat 0 i (double-array [(int (* 255 (Math/pow (/ i 255) (/ 1 _gamma))) )] )))
    lut-mat))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;squealing-valley/lookup-mat</span>","value":"#'squealing-valley/lookup-mat"}
;; <=

;; **
;;; ## Changing the gamma level equals applying the opencv lut function
;; **

;; **
;;; We first create the lookup table from the gamma value and then call the opencv LUT function.
;; **

;; @@
(defn gamma [img _gamma]
 (let [ out (clone img)]
  (lut img (lookup-mat _gamma) out)
   out))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;squealing-valley/gamma</span>","value":"#'squealing-valley/gamma"}
;; <=

;; **
;;; ## Correct Gamma using the above function and a gamma value of 30
;; **

;; @@
(-> "resources/chapter02/emilie1.jpg"
    (imread)
    (u/resize-by 0.07) 
    (gamma 30) 
    (g/>>))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"286\" height=\"215\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4e112814 \"BufferedImage@4e112814: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7e0cc94f transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 286 height = 215 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Correct Gamma using the gamma function and multiple gamma values
;; **

;; @@
(let [img (-> "resources/chapter02/emilie1.jpg" (imread) (u/resize-by 0.05) )]
  (g/>> (hconcat! [img (-> img (gamma 10)) (-> img (gamma 25)) (-> img (gamma 50)) ])))
